---
AbortLocation:
  ENUM:
    0:
      Module:
        NEWTYPE:
          TYPENAME: ModuleId
    1:
      Script: UNIT
AccountAddress:
  NEWTYPESTRUCT:
    TUPLEARRAY:
      CONTENT: U8
      SIZE: 20
CallArg:
  ENUM:
    0:
      Pure:
        NEWTYPE:
          SEQ: U8
    1:
      Object:
        NEWTYPE:
          TYPENAME: ObjectArg
ChangeEpoch:
  STRUCT:
    - epoch: U64
    - storage_charge: U64
    - computation_charge: U64
CircularObjectOwnership:
  STRUCT:
    - object:
        TYPENAME: ObjectID
Data:
  ENUM:
    0:
      Move:
        NEWTYPE:
          TYPENAME: MoveObject
    1:
      Package:
        NEWTYPE:
          TYPENAME: MovePackage
Ed25519KeyPair:
  STRUCT:
    - type: STR
    - name:
        TYPENAME: Ed25519PublicKey
    - secret:
        TYPENAME: Ed25519PublicKey
Ed25519PublicKey:
  NEWTYPESTRUCT: STR
Ed25519Signature:
  NEWTYPESTRUCT: BYTES
EntryArgumentError:
  STRUCT:
    - argument_idx: U8
    - kind:
        TYPENAME: EntryArgumentErrorKind
EntryArgumentErrorKind:
  ENUM:
    0:
      TypeMismatch: UNIT
    1:
      InvalidObjectByValue: UNIT
    2:
      InvalidObjectByMuteRef: UNIT
    3:
      ObjectKindMismatch: UNIT
    4:
      UnsupportedPureArg: UNIT
    5:
      ArityMismatch: UNIT
ExecutionFailureStatus:
  ENUM:
    0:
      InsufficientGas: UNIT
    1:
      InvalidGasObject: UNIT
    2:
      InvalidTransactionUpdate: UNIT
    3:
      ModuleNotFound: UNIT
    4:
      FunctionNotFound: UNIT
    5:
      InvariantViolation: UNIT
    6:
      InvalidTransferObject: UNIT
    7:
      InvalidTransferSui: UNIT
    8:
      InvalidTransferSuiInsufficientBalance: UNIT
    9:
      NonEntryFunctionInvoked: UNIT
    10:
      EntryTypeArityMismatch: UNIT
    11:
      EntryArgumentError:
        NEWTYPE:
          TYPENAME: EntryArgumentError
    12:
      CircularObjectOwnership:
        NEWTYPE:
          TYPENAME: CircularObjectOwnership
    13:
      MissingObjectOwner:
        NEWTYPE:
          TYPENAME: MissingObjectOwner
    14:
      InvalidSharedChildUse:
        NEWTYPE:
          TYPENAME: InvalidSharedChildUse
    15:
      InvalidSharedByValue:
        NEWTYPE:
          TYPENAME: InvalidSharedByValue
    16:
      PublishErrorEmptyPackage: UNIT
    17:
      PublishErrorNonZeroAddress: UNIT
    18:
      PublishErrorDuplicateModule: UNIT
    19:
      SuiMoveVerificationError: UNIT
    20:
      MovePrimitiveRuntimeError: UNIT
    21:
      MoveAbort:
        TUPLE:
          - TYPENAME: ModuleId
          - U64
    22:
      VMVerificationOrDeserializationError: UNIT
    23:
      VMInvariantViolation: UNIT
ExecutionStatus:
  ENUM:
    0:
      Success: UNIT
    1:
      Failure:
        STRUCT:
          - error:
              TYPENAME: ExecutionFailureStatus
Identifier:
  NEWTYPESTRUCT: STR
InvalidSharedByValue:
  STRUCT:
    - object:
        TYPENAME: ObjectID
InvalidSharedChildUse:
  STRUCT:
    - child:
        TYPENAME: ObjectID
    - ancestor:
        TYPENAME: ObjectID
MissingObjectOwner:
  STRUCT:
    - child:
        TYPENAME: ObjectID
    - parent:
        TYPENAME: SuiAddress
ModuleId:
  STRUCT:
    - address:
        TYPENAME: AccountAddress
    - name:
        TYPENAME: Identifier
MoveCall:
  STRUCT:
    - package:
        TUPLE:
          - TYPENAME: ObjectID
          - TYPENAME: SequenceNumber
          - TYPENAME: ObjectDigest
    - module:
        TYPENAME: Identifier
    - function:
        TYPENAME: Identifier
    - type_arguments:
        SEQ:
          TYPENAME: TypeTag
    - arguments:
        SEQ:
          TYPENAME: CallArg
MoveFieldLayout:
  STRUCT:
    - name:
        TYPENAME: Identifier
    - layout:
        TYPENAME: MoveTypeLayout
MoveModulePublish:
  STRUCT:
    - modules:
        SEQ: BYTES
MoveObject:
  STRUCT:
    - type_:
        TYPENAME: StructTag
    - has_public_transfer: BOOL
    - contents: BYTES
MovePackage:
  STRUCT:
    - id:
        TYPENAME: ObjectID
    - module_map:
        MAP:
          KEY: STR
          VALUE: BYTES
MoveStructLayout:
  ENUM:
    0:
      Runtime:
        NEWTYPE:
          SEQ:
            TYPENAME: MoveTypeLayout
    1:
      WithFields:
        NEWTYPE:
          SEQ:
            TYPENAME: MoveFieldLayout
    2:
      WithTypes:
        STRUCT:
          - type_:
              TYPENAME: StructTag
          - fields:
              SEQ:
                TYPENAME: MoveFieldLayout
MoveTypeLayout:
  ENUM:
    0:
      bool: UNIT
    1:
      u8: UNIT
    2:
      u64: UNIT
    3:
      u128: UNIT
    4:
      address: UNIT
    5:
      vector:
        NEWTYPE:
          TYPENAME: MoveTypeLayout
    6:
      struct:
        NEWTYPE:
          TYPENAME: MoveStructLayout
    7:
      signer: UNIT
ObjectArg:
  ENUM:
    0:
      ImmOrOwnedObject:
        NEWTYPE:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    1:
      SharedObject:
        NEWTYPE:
          TYPENAME: ObjectID
ObjectDigest:
  NEWTYPESTRUCT: BYTES
ObjectFormatOptions:
  STRUCT:
    - include_types: BOOL
ObjectID:
  NEWTYPESTRUCT:
    TYPENAME: AccountAddress
ObjectInfoRequestKind:
  ENUM:
    0:
      LatestObjectInfo:
        NEWTYPE:
          OPTION:
            TYPENAME: ObjectFormatOptions
    1:
      PastObjectInfo:
        NEWTYPE:
          TYPENAME: SequenceNumber
Owner:
  ENUM:
    0:
      AddressOwner:
        NEWTYPE:
          TYPENAME: SuiAddress
    1:
      ObjectOwner:
        NEWTYPE:
          TYPENAME: SuiAddress
    2:
      Shared: UNIT
    3:
      Immutable: UNIT
PhantomData: UNITSTRUCT
PublicKeyBytes:
  STRUCT:
    - bytes: BYTES
    - phantom:
        TYPENAME: PhantomData
SequenceNumber:
  NEWTYPESTRUCT: U64
Signature:
  NEWTYPESTRUCT: BYTES
SingleTransactionKind:
  ENUM:
    0:
      TransferObject:
        NEWTYPE:
          TYPENAME: TransferObject
    1:
      Publish:
        NEWTYPE:
          TYPENAME: MoveModulePublish
    2:
      Call:
        NEWTYPE:
          TYPENAME: MoveCall
    3:
      TransferSui:
        NEWTYPE:
          TYPENAME: TransferSui
    4:
      ChangeEpoch:
        NEWTYPE:
          TYPENAME: ChangeEpoch
StructTag:
  STRUCT:
    - address:
        TYPENAME: AccountAddress
    - module:
        TYPENAME: Identifier
    - name:
        TYPENAME: Identifier
    - type_args:
        SEQ:
          TYPENAME: TypeTag
SuiAddress:
  NEWTYPESTRUCT:
    TUPLEARRAY:
      CONTENT: U8
      SIZE: 20
TransactionDigest:
  NEWTYPESTRUCT: BYTES
TransactionEffectsDigest:
  NEWTYPESTRUCT: BYTES
TransactionKind:
  ENUM:
    0:
      Single:
        NEWTYPE:
          TYPENAME: SingleTransactionKind
    1:
      Batch:
        NEWTYPE:
          SEQ:
            TYPENAME: SingleTransactionKind
TransferObject:
  STRUCT:
    - recipient:
        TYPENAME: SuiAddress
    - object_ref:
        TUPLE:
          - TYPENAME: ObjectID
          - TYPENAME: SequenceNumber
          - TYPENAME: ObjectDigest
TransferSui:
  STRUCT:
    - recipient:
        TYPENAME: SuiAddress
    - amount:
        OPTION: U64
TypeTag:
  ENUM:
    0:
      bool: UNIT
    1:
      u8: UNIT
    2:
      u64: UNIT
    3:
      u128: UNIT
    4:
      address: UNIT
    5:
      signer: UNIT
    6:
      vector:
        NEWTYPE:
          TYPENAME: TypeTag
    7:
      struct:
        NEWTYPE:
          TYPENAME: StructTag
TypedStoreError:
  ENUM:
    0:
      RocksDBError:
        NEWTYPE: STR
    1:
      SerializationError:
        NEWTYPE: STR
    2:
      UnregisteredColumn:
        NEWTYPE: STR
    3:
      CrossDBBatch: UNIT

